var inlong = `



`;
var input = `ULL
RRDDD
LURDL
UUUUD`;
input = inlong

var digits = 
    [ [1,2,3],
      [4,5,6],
      [7,8,9]];

var pos=[1,1]
var result=""
function clamp(n,l,h) {
  if (n<l) n = l;
  if (n>h) n = h;
  return n;
}
var lines = input.split('\n')
for (li in lines) {
  var line = lines[li].split("")
  for(ci in line) {
    var c = line[ci]
    switch(c) {
      case 'U': pos[0]-=1;break;
      case 'D': pos[0]+=1;break;
      case 'L': pos[1]-=1;break;
      case 'R': pos[1]+=1;break;
    }
    pos[0] = clamp(pos[0],0,2);
    pos[1] = clamp(pos[1],0,2);
  }
  result = result+digits[pos[0]][pos[1]]
}
result
